import { Box } from '@mui/material';
import { fontSize } from '@mui/system';

import startIcon from '../../assets/img/starIcon.png'

const InformationCard = ({ superHost, type, title, beds, rating }) => {

  superHost === false ? (superHost = null)
    : (superHost = <Box component="span" sx={{
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      width: '100px',
      height: '20px',
      fontSize: '14px',
      fontFamily: 'Monserrate',
      fontWeight: '800',
      border: '1px solid #D7137F',
      borderRadius: '25px',
    }}>
      SUPER HOST</Box>)

    return (
      <Box
        sx={{
          height: '80px',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'space-around',
          alignContent: 'space-between',
          alignItems: 'flex-start',
          fontFamily: 'Monserrate',
          fontSize: '146px',
        }}
      >
        <Box
          sx={{
            display: 'flex',
            width: '395px',
            justifyContent: 'space-between',
            alignItems: 'center',
          }}
        >
          <span> {superHost} </span>
            <span> {type} </span> 
            <span> {beds > 0 && <>. {beds} beds</>} </span> 
          <Box
            sx={{
              display: 'flex',
              flexDirection: 'row',
              alignItems: 'center',
            }}
          >  
            <img src={startIcon} alt="Rating with start icon" srcset="" />
            <span> {rating} </span>
          </Box>
        </Box>
        <Box
          sx={{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            width: '395px'
          }}
        >
          {title}
        </Box>
      </Box>
    );
  };

  export default InformationCard;
